import axios from "axios";
import { useEffect } from "react";
import { useParams } from "react-router-dom";

export default function PlacePage() {
  const id = useParams().id;
  useEffect(() => {
    if (!id) {
      return;
    } else {
      axios.get("/places/" + id);
    }
  }, [id]);
  return <div></div>;
}
